import React from 'react'
import skills from '../images/skills.png'

function Nav() {
    return(
        <nav class="navbar navbar-light bg-light">
  <a class="navbar-brand" href="#">
  <img src={skills} width="30" height="30" alt="" loading="lazy"></img> TODO
  </a>
</nav>
            
    )
}

export default Nav
